import { BrowserRouter, Switch, Route } from 'react-router-dom';

//comps

import { Home } from "./pages/home/Home"
import { Login } from "./pages/login/Login"
import { Signup } from "./pages/signup/Signup"

import './App.css'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route>
          <Signup />
        </Route>


      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App
